let newline lexbuf =
  lexbuf_set_curr_p lexbuf
    ( inc_lnum (lexeme_end lexbuf) (lexeme_end_p lexbuf))

let lexeme (lexbuf : LexBuffer<char>) = new System.String(lexbuf.Lexeme)

